// Presentation.js
import React from 'react';

const Presentation = () => {
  return (
    <section className="px-4 py-8 md:px-8 lg:px-24">
      <h1 className="text-4xl font-bold mb-4 text-center">Bienvenue sur mon portfolio</h1>
      <p className="text-lg text-center">Découvrez mes projets récents et bien plus encore !</p>
    </section>
  );
};

export default Presentation;
